import React, { useEffect, useState } from 'react';
import {
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  Box,
  Button,
  Chip,
  Paper,
  Avatar,
  Divider,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  Fade,
  Slide,
  Zoom,
  IconButton,
  Tooltip,
} from '@mui/material';
import {
  Security,
  CloudUpload,
  Scanner,
  Shield,
  Analytics,
  Speed,
  AutoFixHigh,
  Assessment,
  Visibility,
  BugReport,
  CheckCircle,
  ArrowForward,
  PlayArrow,
  Download,
  Terminal,
  Integration,
  Code,
  Build,
  Rocket,
  ContentCopy,
  GitHub,
  Docker,
  CloudDownload,
} from '@mui/icons-material';
import { useNavigate } from 'react-router-dom';

const Dashboard: React.FC = () => {
  const navigate = useNavigate();
  const [visible, setVisible] = useState(false);
  const [copiedCommand, setCopiedCommand] = useState('');

  useEffect(() => {
    setVisible(true);
  }, []);

  const copyToClipboard = (text: string, command: string) => {
    navigator.clipboard.writeText(text);
    setCopiedCommand(command);
    setTimeout(() => setCopiedCommand(''), 2000);
  };

  const features = [
    {
      title: 'AI-Powered Log Analysis',
      description: 'Advanced ML algorithms detect anomalies in real-time across all AWS log types',
      icon: <Analytics sx={{ fontSize: 48, color: '#8B4513' }} />,
      action: () => navigate('/logs'),
      actionText: 'Analyze Logs',
      highlights: ['5 AWS Log Types', 'Real-time Detection', 'ML Anomaly Engine'],
      delay: 200
    },
    {
      title: 'Infrastructure Security Scanner',
      description: '150+ security rules scan Terraform code for misconfigurations and vulnerabilities',
      icon: <Scanner sx={{ fontSize: 48, color: '#A0522D' }} />,
      action: () => navigate('/scanner'),
      actionText: 'Scan Infrastructure',
      highlights: ['150+ Security Rules', 'Terraform Support', 'Instant Results'],
      delay: 400
    },
    {
      title: 'Intelligent Rule Management',
      description: 'ML automatically generates security rules and learns from your approval patterns',
      icon: <AutoFixHigh sx={{ fontSize: 48, color: '#CD853F' }} />,
      action: () => navigate('/rules'),
      actionText: 'Manage Rules',
      highlights: ['Auto-Generated Rules', 'Human-in-Loop', 'Continuous Learning'],
      delay: 600
    }
  ];

  const stats = [
    { label: 'AWS Services Covered', value: '35+', icon: <Shield />, delay: 100 },
    { label: 'Security Rules', value: '150+', icon: <Assessment />, delay: 200 },
    { label: 'Log Types Supported', value: '5', icon: <Visibility />, delay: 300 },
    { label: 'Processing Speed', value: '<50ms', icon: <Speed />, delay: 400 }
  ];

  const installationMethods = [
    {
      title: 'CLI Installation',
      icon: <Terminal sx={{ fontSize: 32, color: '#8B4513' }} />,
      commands: [
        { label: 'Install via pip', command: 'pip install securon-cli', description: 'Install the Securon CLI tool' },
        { label: 'Scan Terraform', command: 'securon scan file main.tf', description: 'Scan your Terraform files' },
        { label: 'Analyze logs', command: 'securon logs analyze vpc-flow.json', description: 'Analyze AWS logs locally' }
      ]
    },
    {
      title: 'Docker Usage',
      icon: <Docker sx={{ fontSize: 32, color: '#A0522D' }} />,
      commands: [
        { label: 'Pull Docker image', command: 'docker pull securon/platform:latest', description: 'Get the latest Securon image' },
        { label: 'Run container', command: 'docker run -v $(pwd):/workspace securon/platform scan', description: 'Run security scan in container' }
      ]
    },
    {
      title: 'CI/CD Integration',
      icon: <Integration sx={{ fontSize: 32, color: '#CD853F' }} />,
      commands: [
        { label: 'GitHub Actions', command: 'uses: securon/action@v1\nwith:\n  terraform-path: ./infrastructure', description: 'Add to your GitHub workflow' },
        { label: 'GitLab CI', command: 'securon-scan:\n  script:\n    - securon scan file *.tf', description: 'Add to .gitlab-ci.yml' }
      ]
    }
  ];

  const cicdSteps = [
    { step: '1', title: 'Install', description: 'Add Securon to your CI pipeline', icon: <Download /> },
    { step: '2', title: 'Scan', description: 'Automatically scan on every commit', icon: <Scanner /> },
    { step: '3', title: 'Report', description: 'Get detailed security reports', icon: <Assessment /> },
    { step: '4', title: 'Block', description: 'Prevent insecure deployments', icon: <Shield /> }
  ];

  return (
    <Container maxWidth="xl">
      {/* Hero Section */}
      <Box sx={{ 
        textAlign: 'center', 
        py: 8, 
        background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
        borderRadius: 4,
        color: 'white',
        mb: 6
      }}>
        <Typography variant="h2" component="h1" gutterBottom sx={{ fontWeight: 'bold' }}>
          üõ°Ô∏è Securon Platform
        </Typography>
        <Typography variant="h5" sx={{ mb: 4, opacity: 0.9 }}>
          AI-Powered Cloud Security Platform
        </Typography>
        <Typography variant="h6" sx={{ mb: 4, maxWidth: 800, mx: 'auto', opacity: 0.8 }}>
          Detect threats in real-time, scan infrastructure for vulnerabilities, and automatically generate security rules with advanced machine learning
        </Typography>

        <Box sx={{ display: 'flex', gap: 2, justifyContent: 'center', flexWrap: 'wrap' }}>
          <Button
            variant="contained"
            size="large"
            startIcon={<PlayArrow />}
            onClick={() => navigate('/logs')}
            sx={{ 
              bgcolor: 'rgba(255,255,255,0.2)', 
              '&:hover': { bgcolor: 'rgba(255,255,255,0.3)' },
              backdropFilter: 'blur(10px)'
            }}
          >
            Start Analysis
          </Button>
          <Button
            variant="outlined"
            size="large"
            startIcon={<Scanner />}
            onClick={() => navigate('/scanner')}
            sx={{ 
              borderColor: 'rgba(255,255,255,0.5)', 
              color: 'white',
              '&:hover': { borderColor: 'white', bgcolor: 'rgba(255,255,255,0.1)' }
            }}
          >
            Scan Infrastructure
          </Button>
        </Box>
      </Box>

      {/* Key Stats */}
      <Grid container spacing={3} sx={{ mb: 6 }}>
        {stats.map((stat, index) => (
          <Grid item xs={6} md={3} key={index}>
            <Card elevation={2} sx={{ textAlign: 'center', p: 2 }}>
              <Avatar sx={{ bgcolor: 'primary.light', mx: 'auto', mb: 2, width: 56, height: 56 }}>
                {stat.icon}
              </Avatar>
              <Typography variant="h4" color="primary" fontWeight="bold">
                {stat.value}
              </Typography>
              <Typography variant="body2" color="text.secondary">
                {stat.label}
              </Typography>
            </Card>
          </Grid>
        ))}
      </Grid>

      {/* Core Features */}
      <Box sx={{ mb: 6 }}>
        <Typography variant="h4" component="h2" textAlign="center" gutterBottom sx={{ mb: 4 }}>
          üöÄ Powerful Security Features
        </Typography>

        <Grid container spacing={4}>
          {features.map((feature, index) => (
            <Grid item xs={12} md={4} key={index}>
              <Card 
                elevation={3} 
                sx={{ 
                  height: '100%', 
                  display: 'flex', 
                  flexDirection: 'column',
                  transition: 'transform 0.2s',
                  '&:hover': { transform: 'translateY(-4px)' }
                }}
              >
                <CardContent sx={{ flexGrow: 1, textAlign: 'center', p: 3 }}>
                  <Box sx={{ mb: 3 }}>
                    {feature.icon}
                  </Box>

                  <Typography variant="h6" component="h3" gutterBottom fontWeight="bold">
                    {feature.title}
                  </Typography>

                  <Typography variant="body2" color="text.secondary" sx={{ mb: 3 }}>
                    {feature.description}
                  </Typography>

                  <Box sx={{ mb: 3 }}>
                    {feature.highlights.map((highlight, idx) => (
                      <Chip 
                        key={idx}
                        label={highlight} 
                        size="small" 
                        variant="outlined" 
                        sx={{ m: 0.5 }}
                      />
                    ))}
                  </Box>

                  <Button
                    variant="contained"
                    fullWidth
                    endIcon={<ArrowForward />}
                    onClick={feature.action}
                    sx={{ mt: 'auto' }}
                  >
                    {feature.actionText}
                  </Button>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Box>

      {/* USP Section */}
      <Paper 
        elevation={3} 
        sx={{ 
          p: 4, 
          mb: 6, 
          background: 'linear-gradient(135deg, #f5f7fa 0%, #c3cfe2 100%)',
          textAlign: 'center'
        }}
      >
        <Typography variant="h4" component="h2" gutterBottom color="primary" fontWeight="bold">
          üéØ Why Choose Securon?
        </Typography>

        <Grid container spacing={3} sx={{ mt: 2 }}>
          <Grid item xs={12} md={3}>
            <Box>
              <BugReport sx={{ fontSize: 48, color: 'error.main', mb: 2 }} />
              <Typography variant="h6" fontWeight="bold" gutterBottom>
                Real-time Detection
              </Typography>
              <Typography variant="body2" color="text.secondary">
                ML algorithms detect anomalies as they happen, not hours later
              </Typography>
            </Box>
          </Grid>

          <Grid item xs={12} md={3}>
            <Box>
              <AutoFixHigh sx={{ fontSize: 48, color: 'warning.main', mb: 2 }} />
              <Typography variant="h6" fontWeight="bold" gutterBottom>
                Auto-Generated Rules
              </Typography>
              <Typography variant="body2" color="text.secondary">
                AI creates security rules automatically and learns from your feedback
              </Typography>
            </Box>
          </Grid>

          <Grid item xs={12} md={3}>
            <Box>
              <Speed sx={{ fontSize: 48, color: 'success.main', mb: 2 }} />
              <Typography variant="h6" fontWeight="bold" gutterBottom>
                Lightning Fast
              </Typography>
              <Typography variant="body2" color="text.secondary">
                Process thousands of logs in milliseconds with optimized algorithms
              </Typography>
            </Box>
          </Grid>

          <Grid item xs={12} md={3}>
            <Box>
              <CheckCircle sx={{ fontSize: 48, color: 'info.main', mb: 2 }} />
              <Typography variant="h6" fontWeight="bold" gutterBottom>
                Zero Setup
              </Typography>
              <Typography variant="body2" color="text.secondary">
                No training data needed - works immediately with your infrastructure
              </Typography>
            </Box>
          </Grid>
        </Grid>
      </Paper>

      {/* Call to Action */}
      <Box sx={{ textAlign: 'center', py: 4 }}>
        <Typography variant="h5" gutterBottom>
          Ready to Secure Your Cloud Infrastructure?
        </Typography>
        <Typography variant="body1" color="text.secondary" sx={{ mb: 3 }}>
          Start analyzing your logs and scanning your infrastructure in seconds
        </Typography>

        <Box sx={{ display: 'flex', gap: 2, justifyContent: 'center', flexWrap: 'wrap' }}>
          <Button
            variant="contained"
            size="large"
            startIcon={<CloudUpload />}
            onClick={() => navigate('/logs')}
          >
            Upload & Analyze Logs
          </Button>
          <Button
            variant="outlined"
            size="large"
            startIcon={<Scanner />}
            onClick={() => navigate('/scanner')}
          >
            Scan Terraform Code
          </Button>
          <Button
            variant="outlined"
            size="large"
            startIcon={<Shield />}
            onClick={() => navigate('/rules')}
          >
            Manage Security Rules
          </Button>
        </Box>
      </Box>
    </Container>
  );
};

export default Dashboard;
